import styled from 'styled-components';

export const Header = styled.header`
    background-color: red;
    position: fixed;
    display: flex;
    justify-content: space-between;
    width: 100%;
    color: white;
    margin: 2rem auto;
    height: 5rem;
`;

export const Wrapper = styled.div``

export const Image = styled.img``;
